import React from "react";
 
const Popup = props => {
  return (
    <div className="popup-box">
      <div className="box">
        <span className="close-icon" onClick={props.toggle}>x</span>
        <label> laba </label>
      </div>
    </div>
  );
};
 
export default Popup;
